"doc":"Performs DB2 table level restore Args: aux_client_name (str)  auxiliary client name where files are to be restored aux_instance_name (str)  auxiliary instance name where files are to be restored aux_backupset_name (str)  auxiliary backupset name where files are to be restored dest_client_name (str)  destination client name where files are to be restored dest_instance_name (str)  destination db2 instance name of destination client dest_backupset_name (str)  destination db2 backupset name of destination client target_path (str)  Destination DB restore path src_backupset_name (str)  Source Backupset Name staging_path (str)  Staging Path user_name (str)  Destination User name password (str)  Destination User Password tables_path (list)  List of tables path Example: Unix: ['/+tblview+/instance_name/database_name/schema_name/table_name/ '] Windows: [\"\\+tblview+\\instance_name\\database_name\\schema_name able_name\\ \"] copy_precedence (int)  copy precedence value of storage policy copy default: None from_time (str)  time to retore the contents after format: YYYY-MM-DD HH:MM:SS default: None to_time (str)  time to retore the contents before format: YYYY-MM-DD HH:MM:SS default: None rollForward (bool)  Rollforward or not default: True destination_path (str)  destinath path for restore default: None server_port (int)  Server Port Destination instance default: 50000 generateAuthorizationDDL (bool)  Generate Authorization DDL default: False extractDDLStatements (bool)  Extracts DDL statement or not default: True clearAuxiliary (bool)  Cleanup auxilliary or not default: True dropTable (bool)  Drop table for import default: False Returns: object - instance of the Job class for this restore job Raises: SDKException: if failed to initialize job if response is empty if response is not success",
