"doc":"Modifies the Operation rule. Args: modify_options(dict)  Arbitrary keyword arguments. modify_options Args: name (str)  Name of the Operation rule start_date (int)  The start date for the operation rule. Valid values are UNIX-style timestamps (seconds since January 1, 1970). default - current date end_date (int)  The end date for the operation rule. Valid values are UNIX-style timestamps (seconds since January 1, 1970). default - 365 days operations (list)  List of operations for which the operation window is created Acceptable Values: FULL_DATA_MANAGEMENT/NON_FULL_DATA_MANAGEMENT/SYNTHETIC_FULL/ DATA_RECOVERY/AUX_COPY/DR_BACKUP/DATA_VERIFICATION/ERASE_SPARE_MEDIA/ SHELF_MANAGEMENT/DELETE_DATA_BY_BROWSING/DELETE_ARCHIVED_DATA/ OFFLINE_CONTENT_INDEXING/ONLINE_CONTENT_INDEXING/SRM/INFORMATION_MANAGEMENT/ MEDIA_REFRESHING/DATA_ANALYTICS/DATA_PRUNING/BACKUP_COPY/CLEANUP_OPERATION week_of_the_month(list)  List of week of the month on which the operation rule applies to Acceptable Values: all/first/second/third/fourth/last default - None day_of_week (list)  List of days of the week on which the operation rule applies to Acceptable Values: sunday/ monday/ tuesday/ wednesday/ thursday/ friday/ saturday default- Weekdays start_time (int)  The start time for the \"do not run\" interval. Valid values are UNIX-style timestamps (seconds since January 1, 1970). default - 28800 (8 AM) end_time (int)  The end time for the \"do not run\" interval. Valid values are UNIX-style timestamps (seconds since January 1, 1970). default - 86400 (6 PM) do_not_submit_job (bool)  doNotSubmitJob of the operation rule Raises: SDKException: if the Operation window could not be Modified if response is empty if response is not success",
