"doc":"Returns the dictionary consisting of specified type and company plans. Args: plan_type (str)  Type of plan ['DLO', 'Server', 'Laptop', 'Database', 'FSServer', 'FSIBMiVTL', 'Snap', 'VSAServer', 'VSAReplication', 'ExchangeUser', 'ExchangeJournal', 'Office365', 'Dynamics365', 'DataClassification', 'Archiver'] company_name (str)  To filter plans based on company. For Commcell, company_name =  . Default will return all plans Returns: dict - consists of all the plans with specified types configured on the commcell { \"plan1_name\": plan1_id, \"plan2_name\": plan2_id } Raises: SDKException: if input data type is not valid if invalid plan type is passed as parameter if failed to get the response",
